import React from 'react';
import video from '../../assets/Presentation2022.mp4';
import ensemble from '../../assets/ensemble.jpg';

import PropTypes from 'prop-types'

const Curriculum = props => {
  return (
    <div>
      <ul className='text-center'>
        <li className='mb-4'>2019-2022 : Adhérent au Conseil d'architecture, d'urbanisme et de l'environnement</li>
        <li className='mb-4'>Juin 2022 : Présentation de nos travaux devant les parents d'élèves</li>
        <video className='lg:max-w-[700px] mx-auto' controls>
          <source src={video} type="video/mp4"/>
          Votre navigateur ne supporte pas l'affichage de vidéos.
        </video>
        <li>Maquettes 2022</li>
        <li><img src={ensemble} alt="ensemble-" /></li>
        <li></li>
      </ul>
    </div>
  )
}

Curriculum.propTypes = {}

export default Curriculum;
